 function CatagoryFilter(){
    return <aside className="sidebar">
      <ul>
        {SECTIONS.map}
       <li><button className="btn" 
       style={{backgroundColor: "#c5bb76", color: "#000000", marginBottom: "20px"}}>Home</button>
       </li>
      </ul></aside>;
  }

  export default CatagoryFilter;
